import Input from '@material-ui/core/Input';
import TextField from '@material-ui/core/TextField';
import Visibility from '@material-ui/icons/Visibility';
import VisibilityOff from '@material-ui/icons/VisibilityOff';
import Button from '@material-ui/core/Button'

const Login=()=>{

    const hai=()=>{

    }

    const handleClickShowPassword = () => {
        setValues({ ...values, showPassword: !values.showPassword });
      };
    
      const handleMouseDownPassword = (event) => {
        event.preventDefault();
      };
    return(
        <>
            <div className="container-fluid">
                <h1 className="display-4 text-center text-primary">SignUp for New User</h1>
                <div className="row justify-content-center">
                    <div className="col-lg-8 col-md-10 col-sm-12 rounded shadow p-4">
                        <TextField id="outlined-basic" 
                        label="Username" 
                        className="form-control mb-3"
                        variant="outlined" 
                        placeholder="Enter the name"
                        onChange={hai}
                        name="username"
                        value={username}
                        />
                        <Input
                            id="standard-adornment-password"
                            type={values.showPassword ? 'text' : 'password'}
                            value={password}
                            onChange={hai}
                            endAdornment={
                            <InputAdornment position="end">
                                <IconButton
                                aria-label="toggle password visibility"
                                onClick={handleClickShowPassword}
                                onMouseDown={handleMouseDownPassword}
                                >
                                {values.showPassword ? <Visibility /> : <VisibilityOff />}
                                </IconButton>
                            </InputAdornment>
                            }
                        />
                        <div className="row justify-content-around">
                            <Button variant="outlined" color="primary" className="col" onClick={create}>
                                Login
                            </Button>
                            <Button variant="outlined" color="secondary" className="col" onClick={cancel}>
                                Cancel
                            </Button>
                            {/* <Button variant="outlined" color="secondary" className="col" onClick={listUsers}>
                                List
                            </Button> */}
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Login
